  requestPermission();

  return (
    <>
      <Header></Header>
      <BrowserView>
        <h1>
          <Desktop_Title />
        </h1>
      </BrowserView>
      <MobileOnlyView>
        <h1>
          <Desktop_Title />
        </h1>
      </MobileOnlyView>
    </>
  );
};

export default ToMesh;
